			  <TD align='center' class='borderBR divInstruccion' colspan='2'  nowrap='nowrap'><div id='s90row28_3' class='padding2'>Se han reconocido<br />los problemas,<br />no existen procesos<br />estándar para<br />solucionarlos,<br />las soluciones son<br />específicas o propias.</div></TD><TD align='center' class='borderBR divInstruccion' colspan='2'  nowrap='nowrap'><div id='s90row28_4' class='padding2'>La gestión de la<br />organización<br />se realiza por<br />dependencias y se<br />documentan<br />procesos por<br />requisito del<br />SGC.</div></TD><TD align='center' class='borderBR divInstruccion' colspan='2'  nowrap='nowrap'><div id='s90row28_5' class='padding2'>Los procesos están<br />alineados con la<br />estrategia y se han<br />estandarizado<br />documentado<br />y difundido<br />y los colaboradores<br />inician su utilización.</div></TD><TD align='center' class='borderBR divInstruccion' colspan='2'  nowrap='nowrap'><div id='s90row28_6' class='padding2'>Se mide y monitorea<br />el desempeño de los<br />procesos (no áreas) y se<br />mejoran continuamente.<br />Los colaboradores<br />ejecutan su proceso<br />de manera sistemática.</div></TD><TD align='center' class='borderBR divInstruccion' colspan='2'  nowrap='nowrap'><div id='s90row28_7' class='padding2'>Se demuestra que<br />el proceso ha<br />contribuido con el<br />logro de la estrategia<br />y es una mejor práctica<br />comparable o superior<br />con la industria mundial.</div></TD><TD align='center' class='borderBR divInstruccion' colspan='2'  nowrap='nowrap'><div id='s90row28_8' class='padding2'>NS/NR</div></TD>
